description:
Stevie Shae and Ryan are out on a date on a cold winter night. They have some drinks, eat some sushi, marvel at the beauty of a giant christmas tree and all of its lights. Then head home where Stevie is planning to seduce Ryan with a special article of clothing she bought at a lingerie boutique. The two nestle together under a christmas tree and Ryan unwraps her present then gives her two of his own. 

